import React from 'react';
import s from "./skillsSection.module.css"
import SectionWrapper from "../../shared/SectionWrapper";
import Heading from "../../shared/Heading";

const SkillsSection = () => {
    return (
        <SectionWrapper
            alignItems={"center"}
            justifyContent={"center"}
            flexDirection={"column"}
            sectionId={"education"}
            gap={"2rem"}
            backgroundColor={"var(--second-bg-color)"}
        >
            <Heading centered>My <span>Skills</span></Heading>

            <div className={s.skillsRow}>
                <div className={s.skillsColumn}>
                    <h3 className={s.title}></h3>

                    <div className={s.skillsBox}>
                        <div className={s.skillsProgress}>

                        </div>

                    </div>
                </div>
            </div>
        </SectionWrapper>
    );
};

export default SkillsSection;
